// FIREBASE SETUP
import { useState } from "react";
import { Sidebar, Menu, MenuItem, useProSidebar } from "react-pro-sidebar";
import { Box, IconButton, Typography, useTheme } from "@mui/material";
import { Link } from "react-router-dom";
import { tokens } from "../theme";
import RateReviewOutlinedIcon from '@mui/icons-material/RateReviewOutlined';
import HomeOutlinedIcon from "@mui/icons-material/HomeOutlined";
import AccountBalanceSharpIcon from "@mui/icons-material/AccountBalanceSharp";
import DashboardSharpIcon from "@mui/icons-material/DashboardSharp";
import MultilineChartSharpIcon from "@mui/icons-material/MultilineChartSharp";
import SummarizeOutlinedIcon from "@mui/icons-material/SummarizeOutlined";
import ContactsOutlinedIcon from "@mui/icons-material/ContactsOutlined";
import ReceiptOutlinedIcon from "@mui/icons-material/ReceiptOutlined";
import PersonOutlinedIcon from "@mui/icons-material/PersonOutlined";
import CalendarTodayOutlinedIcon from "@mui/icons-material/CalendarTodayOutlined";
import HelpOutlineOutlinedIcon from "@mui/icons-material/HelpOutlineOutlined";
import BarChartOutlinedIcon from "@mui/icons-material/BarChartOutlined";
import PieChartOutlineOutlinedIcon from "@mui/icons-material/PieChartOutlineOutlined";
import TimelineOutlinedIcon from "@mui/icons-material/TimelineOutlined";
import MenuOutlinedIcon from "@mui/icons-material/MenuOutlined";
import MapOutlinedIcon from "@mui/icons-material/MapOutlined";
import Divider from '@mui/material/Divider';
import ReceiptLongOutlinedIcon from '@mui/icons-material/ReceiptLongOutlined';
import NewspaperOutlinedIcon from '@mui/icons-material/NewspaperOutlined';
import CandlestickChartOutlinedIcon from '@mui/icons-material/CandlestickChartOutlined';
import { useAuthContext } from "../contexts/AuthContext"; // Import the context


const Item = ({ title, to, icon, selected, setSelected }) => {
  const theme = useTheme();
  const colors = tokens(theme.palette.mode);
  return (
    <MenuItem
      active={selected === title}
      style={{
        color: colors.grey[100],
      }}
      onClick={() => setSelected(title)}
      icon={icon}
    >
      <Typography>{title}</Typography>
      <Link to={to} />
    </MenuItem>
  );
};

const HamburgerMenu = () => {
  const theme = useTheme();
  const colors = tokens(theme.palette.mode);
  const [isCollapsed, setIsCollapsed] = useState(false);
  const [selected, setSelected] = useState("Dashboard");
  const { collapseSidebar } = useProSidebar();
  const { user } = useAuthContext(); // Fetching user data from context
  
  return (
    <Box
      sx={{
        "& .sidebar-root": {
          backgroundColor: colors.primary[700],
        },
        "& .icon-wrapper": {
          backgroundColor: colors.primary[300],
        },
        "& .pro-inner-item": {
          padding: "5px 35px 5px 20px !important",
        },
        "& .inner-item:hover": {
          color: "#868dfb !important",
        },
        "& .menu-item.active": {
          color: "#FFFFFF !important",
        },
      }}
    >
      <Sidebar
        collapsed={isCollapsed}
        rootStyles={{
          backgroundColor: colors.primary[1000],
        }}
      >
        <Box isCollapsed sx={{ backgroundColor: colors.background }}>
          <Menu iconshape="square">
            <MenuItem
              onClick={() => {
                collapseSidebar();
                setIsCollapsed(!isCollapsed);
              }}
              icon={isCollapsed ? <MenuOutlinedIcon /> : undefined}
              style={{
                margin: "10px 0 20px 0",
                color: colors.blueAccent[700],
              }}
            >
              {!isCollapsed && (
                <Box display="flex" justifyContent="space-between" alignItems="center" ml="15px">
                  <Typography variant="h3" color={colors.grey[100]}>
                    Menu
                  </Typography>
                  <IconButton onClick={() => setIsCollapsed(!isCollapsed)}>
                    <MenuOutlinedIcon />
                  </IconButton>
                </Box>
              )}
            </MenuItem>

            {/* USER */}
            {!isCollapsed && (
              <Box mb="25px">
                <Box display="flex" justifyContent="center" alignItems="center">
                  <img
                    alt="profile-user"
                    width="100px"
                    height="100px"
                    src="https://thumbs.dreamstime.com/b/man-business-suit-icon-illustration-98773345.jpg"
                    style={{ cursor: "pointer", borderRadius: "50%" }}
                  />
                </Box>
                <Box textAlign="center">
                  <Typography
                    variant="h2"
                    color={colors.grey[100]}
                    fontWeight="bold"
                    sx={{ m: "10px 0 0 0" }}
                  >
                    {user?.displayName || "User"}
                  </Typography>
                  <Typography variant="h5" color={colors.greenAccent[100]}>
                    Elite Investor
                  </Typography>
                </Box>
              </Box>
            )}

            {/* MENU ITEMS */}
            <Box paddingLeft={isCollapsed ? undefined : "1%"}>
              <MenuItem
                title="Dashboard"
                routerLink={<Link to="/home"></Link>}
                icon={<HomeOutlinedIcon style={{ color: colors.grey[100] }} />}
                selected={selected}
                color={colors.grey[100]}
                setSelected={setSelected}
              >
                <Typography color={colors.grey[100]}>Stock Listings</Typography>
              </MenuItem>

              <Typography
                variant="h6"
                color={colors.grey[100]}
                sx={{ m: "15px 0 5px 20px" }}
              >
                Data
              </Typography>

              <MenuItem
                title="Watchlist"
                routerLink={<Link to="/watchlist"></Link>}
                icon={<AccountBalanceSharpIcon style={{ color: colors.grey[100] }} />}
                selected={selected}
                setSelected={setSelected}
              >
                <Typography color={colors.grey[100]}>Watchlist</Typography>
              </MenuItem>

              <MenuItem
                title="Portfolio"
                routerLink={<Link to="/portfolio"></Link>}
                icon={<ContactsOutlinedIcon style={{ color: colors.grey[100] }} />}
                selected={selected}
                setSelected={setSelected}
              >
                <Typography color={colors.grey[100]}>Portfolio</Typography>
              </MenuItem>

              <MenuItem
                title="Orders"
                routerLink={<Link to="/orders"></Link>}
                icon={<ReceiptLongOutlinedIcon style={{ color: colors.grey[100] }} />}
                selected={selected}
                setSelected={setSelected}
              >
                <Typography color={colors.grey[100]}>Orders</Typography>
              </MenuItem>

              <Typography
                variant="h6"
                color={colors.grey[100]}
                sx={{ m: "15px 0 5px 20px" }}
              >
                Pages
              </Typography>

              <MenuItem
                title="News"
                routerLink={<Link to="/news"></Link>}
                icon={<NewspaperOutlinedIcon style={{ color: colors.grey[100] }} />}
                selected={selected}
                setSelected={setSelected}
              >
                <Typography color={colors.grey[100]}>News</Typography>
              </MenuItem>

              <MenuItem
                title="IPO"
                routerLink={<Link to="/ipo"></Link>}
                icon={<CandlestickChartOutlinedIcon style={{ color: colors.grey[100] }} />}
                selected={selected}
                setSelected={setSelected}
              >
                <Typography color={colors.grey[100]}>IPO</Typography>
              </MenuItem>

              <MenuItem
                title="Reviews"
                routerLink={<Link to="/testimonials"></Link>}
                icon={<RateReviewOutlinedIcon style={{ color: colors.grey[100] }} />}
                selected={selected}
                setSelected={setSelected}
              >
                <Typography color={colors.grey[100]}>Reviews</Typography>
              </MenuItem>
            </Box>
          </Menu>
        </Box>
      </Sidebar>
    </Box>
  );
};

export default HamburgerMenu;
